import axios from "axios";

const feature = (method, type) => {
  switch (method) {
    case "get":
      console.log("get");
    case "post":
      console.log("get");
    case "put":
      console.log("get");
    case "delete":
      console.log("get");
    default:
      console.log("not");
  }
};

export default feature;
